import React from 'react';
import './SessionsPanel.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faAngleLeft } from '@fortawesome/free-solid-svg-icons'

class SessionsPanel extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <section id="SessionsPanel">
                <section id="SessionsPanelButtons">
                    <FontAwesomeIcon icon={faAngleLeft} className="button" />
                </section>
                <div className="Session">Session #1</div>
                <div className="Session">Session #2</div>
                <div className="Session">Session #3</div>
            </section>
        );
    }
}

export default SessionsPanel;
